const tasks = [
  {
    id: 1,
    text: "Study",
    day: "Saturday",
    reminder: true,
  },
  {
    id: 2,
    text: "gym",
    day: "Monday",
    reminder: true,
  },
  {
    id: 3,
    text: "Tennis",
    day: "Thursday",
    reminder: false,
  },
];

const Tasks = (props) => {
  return <div>{props.tasks}</div>;
};

tasks.defaultProps("No Tasks Added");

export default Tasks;
